    let handleObject = feature=>typeof(feature)=='object' ? JSON.stringify(feature) : feature;
    let fields = ["naam van de buurt", "aantal inwoners", "inwoners tussen 25 en 44", "woningvoorraad (per 1 jan)", "gemiddelde woz waarde", "percentage koopwoningen", "bouwjaar na 2000"];
    let aliases = ["naam van de buurt", "aantal inwoners", "inwoners tussen 25 en 44", "woningvoorraad (per 1 jan)", "gemiddelde woz waarde", "percentage koopwoningen", "bouwjaar na 2000"];
    let table = '<table>' +
        String(
        fields.map(
        (v,i)=>
        `<tr>
            <th>${aliases[i].toLocaleString()}</th>
            
            <td>${handleObject(layer.feature.properties[v]).toLocaleString()}</td>
        </tr>`).join(''))
    +'</table>';
    div.innerHTML=table;
    
    return div
    }
    ,{"className": "foliumpopup"});
                     
</script>
</html>
